function mouseMove(event) {
  mouseX = event.pageX - gameOffsetX;
  mouseY = event.pageY - gameOffsetY;
}


function startBattle(enemy){
	battle = new Battle(SCREEN.BATTLE, enemy);	
	game.pushScene(battle);
}


// Splash screen
var Splash = Class.create(Scene, {
	initialize: function(screen){
		var game = Game.instance;
		this.screen = screen;
		Scene.apply(this);
		
		this.name = screen.name;
		
		if(this.screen == SCREEN.SPLASH){
			//this.backgroundColor = "#000000";
		}else{
			//this.backgroundColor = "#EDDBA9";
		}
		//console.log(screen.name);	
		
		var label = new Label(screen.name);
		label.color = '#FFFFFF';
		label.x		= 10;
		label.y 	= 10;
		this.label 	= label;
		//this.addChild(this.label);		
		
		var emblem = new Sprite(WIDTH, HEIGHT);
		emblem.image = game.assets[screen.image];
		this.addChild(emblem);		
		emblem.tl.delay(30).exec(
			function(){
				if(screen == SCREEN.SPLASH){
					game.replaceScene(new Menu());
				}
			}
		);
		
		this.addEventListener(Event.TOUCH_END, this.input);
		this.addEventListener(Event.ENTER_FRAME, this.update);
	},
	
	input: function(e){
		//console.log("Game Over screen clicked.");
		if(this.screen == SCREEN.GO && game.input.c){
			//console.log("Game Over screen clicked.");
			player.hp = player.maxHp;
			//console.log(player.hp);
			game.popScene(this);
		}
	},
	 
	update: function(e){
		//console.log(mouseX);
	}
});


// Battle scene
var Battle = Class.create(Scene, {
	initialize: function(screen, enemy){
		
		Scene.apply(this);		
		this.name = screen.name;
		battleScene = this;
		
		var background = new Sprite(WIDTH, HEIGHT);
		background.image = game.assets[screen.backgroundImage];
		this.addChild(background);
		
		var battlePlayer = new Sprite(192, 192);
		battlePlayer.image = game.assets['./assets/sprites/battlePlayer.png'];
		battlePlayer.x = 90;
		battlePlayer.y = 230;
		this.addChild(battlePlayer);
		
		battleEnemy = new Sprite(150, 150);
		battleEnemy.image = game.assets['./assets/sprites/battleEnemy.png'];
		battleEnemy.x = 480;
		battleEnemy.y = 100;
		this.addChild(battleEnemy);
		
		var foreground = new Sprite(WIDTH, HEIGHT);
		foreground.image = game.assets[screen.foregroundImage];
		this.addChild(foreground);		
		
	
		// battle labels
		playerStats = new Label();
		playerStats.text = "HP : " + player.hp + " / " + player.maxHp;		
		playerStats.x	= 400;
		playerStats.y 	= 330;
		this.addChild(playerStats);

			
		enemyStats = new Label();
		enemyStats.text = "HP : " + enemy.hp + " / " + enemy.MaxHp;
		enemyStats.x		= 80;
		enemyStats.y 	= 100;
		this.addChild(enemyStats);
		
		battleStats = new Label();
		battleStats.x	= 150;
		battleStats.y 	= 460;
		this.addChild(battleStats);
		
		
		var attackOption = new Label();
		attackOption.text = "ATTACK"
		attackOption.x = 50;
		attackOption.y = 460;		
		attackOption.addEventListener(Event.TOUCH_END, this.attack);
		
		this.addChild(attackOption);


		/*
		var label = new Label(screen.name);
		label.color = '#FFFFFF';
		label.x		= 10;
		label.y 	= 10;
		this.addChild(label);				
		*/
		
		this.addEventListener(Event.TOUCH_END, this.input);
		this.addEventListener(Event.ENTER_FRAME, this.update);
	},
	
	attack: function(){
		player.target.hp -= player.attackDamage;
		battleStats.text = "Attack!";

	},
	
	input: function(e){
		
		if(player.target.hp <= 0){
			battleStats.text = "You won!";
			this.removeChild(battleEnemy);
			this.tl.delay(100).exec(game.popScene(this));
		}
	},
	 
	update: function(e){
		enemyStats.text = "HP : " + player.target.hp + " / " + player.target.MaxHp;
	}
});

// Menu
var Menu = Class.create(Scene, {
	initialize: function(e){
		var game = Game.instance;
		Scene.apply(this);
		menu = this;
		
		this.name = "Menu"

		//this.backgroundColor = '#EDDBA9';
		console.log("Menu Screen");
		
		background = new Sprite(WIDTH, HEIGHT);
		background.image = game.assets['./assets/backgrounds/menuBackground.png'];
		
		background2 = new Sprite(WIDTH, HEIGHT);
		background2.image = game.assets['./assets/backgrounds/menuBackground.png'];
		
		background2.y = -HEIGHT;
		
		this.addChild(background);
		this.addChild(background2);
		
		var label = new Label('Menu Screen');
		label.color = '#FFFFFF';
		label.x		= 10;
		label.y 	= 10;
		this.label 	= label;
		this.addChild(this.label);		
		
		var label = new Label("Start");
		label.font = '24px Segoe UI';
		label.color = '#FFFFFF';
		label.x   = WIDTH - 100;
		label.y   = HEIGHT - 100;
		label.addEventListener(Event.TOUCH_END, function(){
			game.replaceScene(new PlayerSelect());
		});
		this.addChild(label);
		
		var label = new Label("Load");
		label.font = '24px Segoe UI';
		label.color = '#FFFFFF';
		label.x   = WIDTH - 100;
		label.y   = HEIGHT - 70;
		this.addChild(label);
		
		this.addEventListener(Event.TOUCH_END, this.input);
		this.addEventListener(Event.ENTER_FRAME, this.update);
	},	
	
	input: function(e){	
	},
	
	update: function(e){		
		//console.log(mouseX);
		
		// this is for the awesome menu background scrolling
		background.y+=5;
		background2.y+=5;
		if(background.y >= HEIGHT){
			background.y = -HEIGHT + 20;
		}
		if(background2.y >= HEIGHT){
			background2.y = -HEIGHT + 20;
		}
				
	}
});

