// Target / pointer
var Pointer = Class.create(Sprite, {
	initialize: function(){
		var game = Game.instance;
		this.name = "Pointer"
		//console.log("Pointer");
		Sprite.call(this, 32, 32); // call the Sprite super class constructor
		this.image = game.assets['./assets/sprites/target.png'];
					
		this.frame = 0;					
		this.anim = [0, 1, 2, 3, 4];		

		this.addEventListener(Event.ENTER_FRAME, this.update);
	},

	remove: function(e){
		this.frame = 0;
		worldMap.removeChild(this);
		//console.log("Pointer removed");
		
	},	
	
	update: function(e){
		// update pointer co ordinates
		this.x = player.targetX - this.width / 2;
		this.y = player.targetY - this.height / 2;	
		this.frame++;
		if(this.frame > 3) this.remove();		
	}
});



